import "./navbar.css"
import React from 'react';


export default function Navbar() {
  return (
    <div class="topnav">



        <form action="/action_page.php">
          <input type="text" placeholder="Search.." name="search" />
          <button type="submit"><i class="fa fa-search"></i></button>
        </form>

    </div>
  )

}
